mapper.select:

select 

from TB_SITE_WORK_ANT_CFG_TEMP
where WORK_ID = #{WORK_ID,jdbcType=VARCHAR}
  and SITE_ID = #{SITE_ID,jdbcType=VARCHAR}
  and ANT_NO = #{ANT_NO,jdbcType=VARCHAR}

mapper.delete:

delete from TB_SITE_WORK_ANT_CFG_TEMP
where WORK_ID = #{WORK_ID,jdbcType=VARCHAR}
  and SITE_ID = #{SITE_ID,jdbcType=VARCHAR}
  and ANT_NO = #{ANT_NO,jdbcType=VARCHAR}
